import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';



function One(){
  return (
    <div>
      <h1> Day la cach so 1 </h1>
      <p>HAHAHAHH</p>
    </div>
  )
}

var Two = () => (
  <div>
    <h2> Day la the h2 </h2>
    <p> Day la cach so 2 </p>
  </div>
)

class Four extends Component {
  render(){
    return (
      <div>
        Tu mien nam anh nguoc ra bac mang theo cau ho dieu ly bon nghin nam!!
        Mang Theo tam long con trai miet vuon!!!
      </div>
    )
  }
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Four />
      </header>
    </div>
  );
}

export default App;
